import React from 'react';

const Home = () => {
  return (
    <div className="flex flex-col items-center justify-center min-h-screen">
      <div className="flex flex-row items-center justify-center mb-12">
        <img
          src={require('../assets/westwood-logo.png')}
          alt="Westwood Logo"
          className="w-36 h-36 mr-5 object-contain"
        />
        <h1 className="text-2xl font-bold text-center gradient-text">Westwood High School</h1>
      </div>
      <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className="absolute bottom-5 w-24 h-24">
        <line x1="12" y1="5" x2="12" y2="19"></line>
        <polyline points="19 12 12 19 5 12"></polyline>
      </svg>
    </div>
  );
};

export default Home;
